  of Sea-Floor Photographs Acquired During U.S. Geological Survey (USGS) Cruise 2011-006-FA
  in Block Island Sound (2011_006_BISBOTPHOTOS.SHP, Geographic, WGS84)\",\n\t\"tracking_summary\":
